	(4,'Maria','Tur',(SELECT trunc(1 + random()*(SELECT max(contact.contact_id) FROM vet_clinic.contact))::INTEGER) ,(SELECT trunc(1 + random()*(SELECT max(address.address_id) FROM vet_clinic.address))::INTEGER) ),
