			WHERE miejscowosc = (SELECT miejscowosc.miejscowosc FROM slownik.miejscowosc WHERE miejscowosc.id_miejscowosci = miejscowosc_id)) AS miejscowosc_sbq;

		VALUES (
            miejscowosc_nazw,
