    END LOOP;
	RAISE NOTICE 'Dodano % krajów', (SELECT COUNT(*) FROM vet_clinic.address);

    RAISE NOTICE 'Generuję dane dla tabeli contact';
    FOR i IN 1..liczba_kontaktow
