    visit.visit_time AS taken_time_start,
        CASE
            WHEN ((visit.visit_type)::text = 'wizyta'::text) THEN (visit.visit_time + '00:15:00'::interval)
            WHEN ((visit.visit_type)::text = 'kontrola'::text) THEN (visit.visit_time + '00:15:00'::interval)
            WHEN ((visit.visit_type)::text = 'zabieg'::text) THEN (visit.visit_time + '00:45:00'::interval)
            WHEN ((visit.visit_type)::text = 'badanie'::text) THEN (visit.visit_time + '00:30:00'::interval)
            ELSE NULL::time without time zone
        END AS taken_time_stop
   FROM vet_clinic.visit
  WHERE (visit.visit_date = (now())::date)
  ORDER BY visit.visit_time, visit.office_id;


