CREATE OR REPLACE VIEW vet_clinic.kwerenda_b1_query AS
 SELECT count(personnel.visit_id) AS "Ilosc Wizyt",
    vet.first_name,
    vet.last_name
   FROM (vet_clinic.personnel
     JOIN vet_clinic.vet ON ((personnel.vet_id = vet.vet_id)))
  GROUP BY vet.vet_id
  ORDER BY ( SELECT count(personnel.visit_id) AS count) DESC;


